import React from 'react'
import {Container} from 'react-bootstrap'

const LoggedInHomescreen = (props) => {
    return (
        <div>
            <Container>
                Welcome, {props.route.name}!
            </Container>
        </div>
    )
}

export default LoggedInHomescreen
